def countVisitedNodes1(edges):
    countNodes = [0 for _ in range(len(edges))]
    cycles = set([])

    def dfs(u, pathVisited):
        # but if you visit a node youve seen during the dfs, that's a cycle
        v = edges[u]
        if v in pathVisited: 
            cycles.add(v)
            return 
        # if you visit a node that you've seen overall, that's ok you just stop
        if v in visited:
            return 
        visited.add(v)
        pathVisited.add(v) 
        dfs(v, pathVisited)       

    # find all of the cycles
    visited = set([])
    for i in range(len(edges)):
        if i not in visited: 
            visited.add(i)
            dfs(i, set([i]))

    # then "back fill " the cycles
    def backfill(u):
        backfillVisited = set([u])
        cyclesVisited.add(u)
        # find length of cycle
        cycleLength = 1
        cur = edges[u]
        while cur != u: 
            cycleLength += 1
            backfillVisited.add(cur)
            cyclesVisited.add(cur)
            cur = edges[cur]
    
        # apply length of cycle to all in path
        for x in backfillVisited: 
            countNodes[x] = cycleLength
        return 

    cyclesVisited = set([])
    for x in cycles: 
        backfill(x)

    # dfs until you reach a cycle
    def dfsNonCycles(u):
        numNodes = 1
        v = edges[u]
        if v in cyclesVisited: 
            numNodes += countNodes[v]
        else: 
            numNodes += dfsNonCycles(v)
        countNodes[u] = numNodes 
        return numNodes

    for i in range(len(edges)):
        if i not in cyclesVisited:
            dfsNonCycles(i)

    return countNodes



# using topological sort: 
# indegrees; how many nodes are coming into the current node
# - if you have a cycle, then indegrees will be > 0
# - 

from collections import deque
def countVisitedNodes(edges):
    countNodes = [0 for _ in range(len(edges))]
    visited = [False for _ in range(len(edges))]
    indegrees = [0 for _ in range(len(edges))]
    for u in range(len(edges)):
        v = edges[u]
        indegrees[v] += 1

    queue = deque([])
    for u, n in enumerate(indegrees): 
        if n == 0: queue.append(u)

    while queue: 
        u = queue.popleft()
        visited[u] = True
        v = edges[u]
        indegrees[v] -= 1
        if indegrees[v] == 0: 
            queue.append(v)

    cycles = set([])
    def cycleLength(u):
        cycles.add(u)
        visited[u] = True
        cycleLength = 1
        cycleNodes = set([u])
        cur = edges[u]
        while cur != u: 
            cycles.add(cur)
            cycleLength += 1
            visited[cur] = True
            cycleNodes.add(cur)
            cur = edges[cur]

        for node in cycleNodes: 
            countNodes[node] = cycleLength

    # find the cycles
    for i in range(len(visited)):
        if not visited[i]:
            cycleLength(i)

    def dfs(u):
        v = edges[u]
        numNodes = 1
        if v not in visited: 
            visited.add(v)
            numNodes += dfs(v)            
        else: 
            numNodes += countNodes[v]
        countNodes[u] = numNodes
        return numNodes

    # now traverse rest of the cycles
    visited = set([u for u in cycles])
    for i in range(len(edges)):
        if i not in visited: 
            dfs(i)

    return countNodes

